        <div>
        
            {props.data.map(item => (
                <ul>
                    <span> {item.id}.  {item.title}  </span>
                    <Button color="danger">Edit</Button> {'     '}
                    <Button color="danger">Delete</Button>
                </ul>
            )
            )}   
        </div>
    );
};
